import React from 'react'
import styled from 'styled-components'

let Flex = styled.div`

    display: flex;
        justify-content:center;
        align-items:center;
        flex-direction:column;

`
let Title = styled.h1`
    margin-top: 5rem;
    font-size: 3rem;
    color: #fff;

`
let Cblock = styled.div`

    max-width: 400px;
    height:600px;
    width: 100%;
    display:flex;
    flex-direction:column
    justify-content:center;
    align-items:center;
    background-color:#6066FF;
`

let Lbl = styled.label`
        color: #fff;

`
let Clmn = styled.div`
margin: 40px auto;
    display:flex;
`

export default function Register() {
  return (
    <Flex>
<Cblock>
<Title>Register</Title>
        <form >
            <Clmn>
                <Lbl htmlFor='register'>Register</Lbl>
                <input type='text'/>
            </Clmn>
        </form>
</Cblock>

    </Flex>
  )
}
